import React from 'react';
import styled from 'styled-components';
import './Logo.js';

const SearchbarS = styled.div`
  position: relative;
  width: 300px;
  height: 36px;
  text-align: center;
  margin-left:20px;
  margin-right:8px;
`;

const Icon_FilterS = styled.img`
  position : absolute;
  width: 17px;
  top: 10px;
  right: 12px;
  margin: 0;
`;

const Icon_SearchS = styled.img`
  position : absolute;
  width: 17px;
  top: 10px;
  right: 12px;
  margin: 0;
`;

function Searchbar({ children }) {

  return <SearchbarS>
    <Icon_FilterS src="https://cdn-icons-png.flaticon.com/512/4502/4502383.png"/>
    <input class="header_searchbar" type="text" placeholder="검색어 입력"/>
    <Icon_SearchS src="https://s3.ap-northeast-2.amazonaws.com/cdn.wecode.co.kr/icon/search.png"/>
  </SearchbarS>;
}

export default Searchbar;
